quantum_circuit:
OPENQASM 3.0;
include "stdgates.inc";
gate mcmt _gate_q_0, _gate_q_1 {
  cz _gate_q_0, _gate_q_1;
}
gate Q _gate_q_0, _gate_q_1 {
  x _gate_q_0;
  x _gate_q_1;
  mcmt _gate_q_0, _gate_q_1;
  x _gate_q_0;
  x _gate_q_1;
  h _gate_q_1;
  h _gate_q_0;
  x _gate_q_0;
  x _gate_q_1;
  h _gate_q_1;
  cx _gate_q_0, _gate_q_1;
  h _gate_q_1;
  x _gate_q_0;
  x _gate_q_1;
  h _gate_q_0;
  h _gate_q_1;
}
gate Q_0 _gate_q_0, _gate_q_1 {
  Q _gate_q_0, _gate_q_1;
}
bit[2] meas;
qubit[2] q;
h q[0];
h q[1];
Q_0 q[0], q[1];
barrier q[0], q[1];
meas[0] = measure q[0];
meas[1] = measure q[1];
